function filterMenu(){var i,r,u,t,f,n;for(i=document.getElementById("filterInput"),r=i.value.toUpperCase(),u=document.getElementById("filterList"),t=u.getElementsByTagName("li"),n=0;n<t.length;n++)f=t[n].getElementsByTagName("a")[0],t[n].style.display=f.innerHTML.toUpperCase().indexOf(r)>-1?"":"none"}